import React from 'react';
import NavBar from '../Components/navbar';
import VertNavBar from '../Components/verticalnavbar'


function CSGO() {
  return (
  	<div>
    	<NavBar/>
    		<div class="vertnavbar">	
    			<VertNavBar/>
    		</div>
    </div>
  );
}

export default CSGO;
